import React from 'react';
import s from './users.module.css'
let Users = (props) => {

    if (props.users.length === 0) {
    props.setUsers ( [
        {id: '1', photoUrl: 'data:image/jpeg;base64,',
            followed: false, fullName: 'Ditry', status: 'I am a boss', location: {city: 'Minsk', country: 'Belarus'} },
        {id: '2', photoUrl: 'data:image/jpeg;base64,',
            followed: true, fullName: 'Sasha', status: 'I am a boss', location: {city: 'Moscow', country: 'Russia'} },
        {id: '3', photoUrl: 'data:image/jpeg;base64,',
            followed: false, fullName: 'Dima', status: 'I am a boss', location: {city: 'Kiev', country: 'Ukrain'} },
        {id: '4', photoUrl: 'data:image/jpeg;base64,',
            followed: true, fullName: 'Asel', status: 'I am a boss', location: {city: 'Kyrgyzstan', country: 'Bishkek'} },
        ]
    )
    }

    return <div>
        {
            props.users.map(u => <div key={u.id}>
               <span>
                   <div>
                       <img src={u.photoUrl}alt="" className={s.userPhoto}/>
                   </div>
                   <div>
                       { u.followed
                           ? <button onClick={ () => { props.unfollow(u.id) } }>Unfollow</button>
                           :  <button onClick={() => { props.follow(u.id)}}>Follow</button>}
                   </div>
               </span>
                <span>
                    <span>
                        <div>{u.fullName}</div>
                        <div>{u.status}</div>
                    </span>
                    <span>
                        <div>{u.location.country}</div>
                        <div>{u.location.city}</div>
                    </span>
                </span>
            </div>)
        }
    </div>
}
 export default Users;
